window.bookSummaryJSON = "<p><b>Lukas tries to resurrect the goddess Inanna while exploring a world forgotten by the Origin itself in the fourth book of this action-packed LitRPG series.</b></p> <p>The curse of the lost goddess Inanna would not allow Lukas Aguilar to hide out in obscurity for long. To become the conquering invader, the protective monster, and the selfish Outsider who would risk the end of the world itself, he must instead embrace audacity.</p> <p>Accompanied by the quirky shade of the former Empress Meynte, Lukas wanders the endless Haze, searching for a way to bring Inanna back in a reality not his own. But with the threat of the Shimizu warlord hanging like a sword above them—and new and powerful forces taking note—he will also have to find a way to even the odds.</p> <p>Meanwhile, Lukas is still working to solve the mysteries of the shard of the world within him: the abstruse Plains of Forget. And he is about to discover that when you tinker with the fabric of reality, you might have to pay for it—and then some....</p> <p><b>The fourth volume of the hit LitRPG adventure series—with almost a million views on Royal Road—now available on Audible and wherever ebooks are sold!</b></p>"; 
